      {
        name: "imran",
      },
      {
        name: "kaka",
      },
    ]);
  }, 500);
  return (
    <div>
        <Navbar/>
        <Slider/>
        {itemitem.map((k)=>{
          <h1 style={{marginTop:"500px"}}>k</h1>
        })}
    </div>
  )
}
